import React, { useEffect } from "react";
import { LuListTodo } from "react-icons/lu";
import { IoCalendarNumber } from "react-icons/io5";
import { FaRegNoteSticky } from "react-icons/fa6";
import { BiLogOut, BiSolidDashboard } from "react-icons/bi";
import { useNavigate } from "react-router-dom";
import icon from "../utils/icon.PNG";
import Aos from "aos";
import "aos/dist/aos.css";

const Navbar = ({ toast }) => {
  const navigate = useNavigate();

  useEffect(() => {
    Aos.init({ duration: 800 });
  }, []);

  function logOut() {
    // Mock response
    const mockResponse = {
      data: {
        success: true, // Mock dữ liệu thành công
      },
    };
  
    if (mockResponse?.data?.success) {
      toast.success("Logged out successfully");
      navigate("/");
    } else {
      toast.error("Logout failed");
    }
  }

  return (
    <nav className="nav-left" data-aos="fade-right">
      <button className="todo-theme">
        <img src={icon} alt="" />
      </button>
      <button className="nav-icon skull" onClick={() => navigate("/Home")}>
        <BiSolidDashboard size={22} />
      </button>
      <button className="nav-icon skull" onClick={() => navigate("/Home/todos")}>
        <LuListTodo size={20} />
      </button>
      <button className="nav-icon skull" onClick={() => navigate("/Home/task")}>
        <IoCalendarNumber size={20} />
      </button>
      <button className="nav-icon skull" onClick={() => navigate("/Home/notes")}>
        <FaRegNoteSticky size={20} />
      </button>
      <button className="nav-icon skull" onClick={logOut}>
        <BiLogOut size={22} />
      </button>
    </nav>
  );
};

export default Navbar;
